import React, { Component } from 'react';
import './Hello.css';

class Hello extends Component {
    render() {
        return (
        <div class='f1 tc'>
            <h1>Hello World</h1>
            <p>Welcome to React</p>
        </div>
        )
    }
}

export default Hello;
